createNewObjectString:
(pastTrainingSamples = []) => {
  const {
    multilabel,
    Winnow,
    EnhancedClassifier
  } = require('limdu').classifiers; // Word extractor - a function that takes a sample and adds features to a given features set:


  const TextClassifier = multilabel.BinaryRelevance.bind(0, {
    binaryClassifierType: Winnow.bind(0, {
      retrain_count: 10
    })
  });
  const classifier = new EnhancedClassifier({
    classifierType: TextClassifier,
    featureExtractor: (input, features) => {
      //similar to limdu.features.NGramsOfWords(1)
      input.split(/[ \t,;:.-_]/) //perhaps remove _ to keep emoji words joint
      .filter(Boolean).forEach(word => {
        features[word.toLowerCase()] = 1;
      });
    },
    //or extract
    pastTrainingSamples
  });
  return classifier;
}
